
// Various accessors that specify the four dimensions of data to visualize.
function x(d) { return d.values.review_score; }
function y(d) { return d.values.price; }
function radius(d) { return ((d.values.bookings + 1) * 100000000); }
function color(d) { return d.key; }
function key(d) { return d.key; }
function independant(d) {
	
	if (d.values.independant_bool == 1)
		{return "blue";}
	else if (d.values.independant_bool == 0)
		{return "black";}
}
//function key(d) { return d.name; }

// Chart dimensions.
var margin = {top: 30, right: 350, bottom: 150, left: 100},
    width = window.innerWidth - margin.right,
    height = window.innerHeight - margin.top - margin.bottom;

// Various scales. These domains make assumptions of data, naturally.
var xScale = d3.scale.linear().domain([0, 8]).range([0, width]),
    yScale = d3.scale.linear().domain([0, 1000]).range([height, 0]),
    radiusScale = d3.scale.sqrt().domain([0, 5e8]).range([0, 40]),
    colorScale = d3.scale.category10();

// The x & y axes.
var xAxis = d3.svg.axis().orient("bottom").scale(xScale).ticks(12, d3.format(",d")),
    yAxis = d3.svg.axis().scale(yScale).orient("left");

// Create the SVG container and set the origin.
var svg = d3.select("#chart").append("svg")
    .attr("width", width + margin.left + margin.right)
    .attr("height", height + margin.top + margin.bottom)
    .append("g")
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

// Add the x-axis.
svg.append("g")
    .attr("class", "x axis")
    .attr("transform", "translate(0," + height + ")")
    .call(xAxis);

// Add the y-axis.
svg.append("g")
    .attr("class", "y axis")
    .call(yAxis);

// Add an x-axis label.
svg.append("text")
    .attr("class", "x label")
    .attr("text-anchor", "end")
    .attr("x", width)
    .attr("y", height - 6)
    .text("User Review (Out of five)");

// Add a y-axis label.
svg.append("text")
    .attr("class", "y label")
    .attr("text-anchor", "end")
    .attr("y", 6)
    .attr("dy", ".75em")
    .attr("transform", "rotate(-90)")
    .text("Hotel Price(dollars)");

// Add the year label; the value is set on transition.
var label = svg.append("text")
    .attr("class", "year label")
    .attr("text-anchor", "end")
    .attr("y", height - 24)
    .attr("x", width)
    .text(2012);

//this one filters the time in question of the data in question
		function filter_year(filter) {
			var f = eval(filter);
			var object;
			if ( typeof (f.length) != "undefined") {
			} else {
			}
			if ( typeof (f.top) != "undefined") {
				f = f.top(Infinity);
			} else {
			}
			if ( typeof (f.dimension) != "undefined") {
				f = f.dimension(function(d) {
					return "";
				}).top(Infinity);
			} else {
			}

			yearPoints = [];
			for (var i = 0; i < f.length; i++) {
				object = f[i];
				yearPoints.push(object);
			}
			return yearPoints;
		}

d3.json("/static/visual/js/result.json", function(data) {
//function plotGraph(data){
  // Add a dot per nation. Initialize the data at 1800, and set the colors.
  var dot = svg.append("g")
      .attr("class", "dots")
      .selectAll(".dot")
      .data(interpolateData(2011))
      .enter().append("circle")
      .attr("class", "dot")
      .style("fill", function(d) { return colorScale(color(d)); })
      .style("opacity", 0.5)
      .style("stroke", function(d){return independant(d);})
      .call(position)
      .sort(order);

  // Add a title.
  dot.append("title")
      .text(function(d) { return d.key; });

  // Add an overlay for the year label.
  var box = label.node().getBBox();

  var overlay = svg.append("rect")
        .attr("class", "overlay")
        .attr("x", box.x)
        .attr("y", box.y)
        .attr("width", box.width)
        .attr("height", box.height)
        .on("mouseover", enableInteraction);

  // Positions the dots based on data.
  function position(dot) {
    dot .attr("cx", function(d) { return xScale(x(d)); })
        .attr("cy", function(d) { return yScale(y(d)); })
        .attr("r", function(d) { return radiusScale(radius(d)); })
        ;
  }

  // Defines a sort order so that the smallest dots are drawn on top.
  function order(a, b) {
    return radius(b) - radius(a);
  }

  // After the transition finishes, you can mouseover to change the year.
  function enableInteraction() {
    var yearScale = d3.scale.linear()
        .domain([2012, 2013])
        .range([box.x + 10, box.x + box.width - 10])
        .clamp(true);

    // Cancel the current transition, if any.
    svg.transition().duration(0);

    overlay
        .on("mouseover", mouseover)
        .on("mouseout", mouseout)
        .on("mousemove", mousemove)
        .on("touchmove", mousemove);

    function mouseover() {
      label.classed("active", true);
    }

    function mouseout() {
      label.classed("active", false);
    }

    function mousemove() {
      displayYear(yearScale.invert(d3.mouse(this)[0]));
    }
  }

  // Tweens the entire chart by first tweening the year, and then the data.
  // For the interpolated data, the dots and label are redrawn.
  function tweenYear() {
    var year = d3.interpolateNumber(2012, 2014);
    return function(t) {displayYear(year(t)); };
  }

  // Updates the display to show the specified year.
  function displayYear(year) {
    roundyear = Math.round(year);
    dot.data(interpolateData(roundyear), key).call(position);
    label.text(Math.round(year));
  }

  // Interpolates the dataset for the given (fractional) year.
  function interpolateData(year) {
		var crossData = crossfilter(data);
		var dataDim = crossData.dimension(function(d) {
			return d.year;});
		var filterData = dataDim.filter(year);
		var yearData = filter_year(filterData);
		//console.log("input");
        //console.log(JSON.stringify(yearData));
		 var finalArray = d3.nest()
		  .key(function(d) { return d.name; })
		  .rollup(function(v) { return {
		    price: d3.mean(v, function(d) { return d.price; }),
		    bookings: d3.sum(v, function(d) { return d.bookings; }),
		    review_score: d3.mean(v, function(d) {return d.review_score; }),
		    desirability: d3.mean(v, function(d){return d.desirability; }),
		    independant_bool: d3.mean(v,function(d){return d.independant_bool;})}; })
		  .entries(yearData);
		//console.log("output");
		//console.log(JSON.stringify(finalArray));
		return finalArray;
  }

});


